      require(
        (
          isItemTransferrable(id) ||
          from == address(0) || // allow mint
          hasRole(OWNER_ROLE, from) || // allow owner transfers
          hasRole(MINTER_ROLE, from) || // allow minter transfers
          to == address(0) // allow burn
        ),
        "Item is not currently transferable."
      );

